const Game = window['Game'];
class AsideComponent {
    constructor(service) {
        this.service = service;
        this.startLabel = 'Pause';
        this.interations = 0;
        this._interval = 0;
        this.status = true;
        this.subscriptions = [];
        this.subscriptions[this.subscriptions.length] = this.service.getTurnCount().subscribe(count => {
            this.interations = count;
        });
        this.interval = 1500;
    }
    get interval() {
        return this._interval;
    }
    set interval(value) {
        this.service.sendInterval(value);
        this._interval = value;
    }
    ngOnInit() {
        setTimeout(() => {
            this.service.start();
        }, 2000);
    }
    start(event) {
        if (this.status) {
            this.service.pause();
            this.status = false;
            this.startLabel = 'Start';
        }
        else {
            this.service.start();
            this.status = true;
            this.startLabel = 'Pause';
        }
    }
    stop(event) {
        Game.status = false;
    }
}


